import React from 'react';
import '../Styles/Projects.css';
import CNNup from '../assets/CNN-LayDown.png';
import CNNlaying from '../assets/CNN-LayDown.png';


// import React, { useState } from 'react'

function Projects() {
    // const [projects, setProjects] = useState([
    //     { projectName: ''},
    // ]);

    return (
        <div className="frame">

            <div class="grid-container">
                <div class="grid-item">
                    {/* <div className="project-details"> */}
                    <p>Convolutional Nerual Network</p>
                    <p>Univesity Course Work</p>
                    <p>Paper proposing possible way to use CNN to identifying structural damage within reinforced concrete using Radiographs, also known as X-rays</p>
                    <p>View Paper</p>
                    <div className="project-tags">
                        <p>Built With:</p>
                        <p>React.js</p>
                        <p>HTML</p>
                        <p>CSS</p>
                        <p>JavaScripts</p>
                    </div>

                    {/* </div> */}
                </div>
                <div class="grid-item">
                    {/* <div className="project-images"> */}
                    <img src={CNNup} alt="gitHub" width="50em" height="50em"></img>
                    <img src={CNNlaying} alt="gitHub" width="50em" height="50em"></img>
                    {/* </div> */}
                </div>

            </div>



            <div className="project-tags">    
            </div>
        </div>
    )
}

export default Projects
